//import 
import '../../../styles/acco.css';
//function 
const Accordion = (props) =>{
    return(
        <div class="accordion-item">
        <input type="checkbox" id="gardener" class="accordion-checkbox"/>
        <label class="accordion-toggle" for="gardener">{props.title}</label>
        <div class="accordion-content">
            <p>
                {props.desc}
            </p>
        </div>
    </div>
    )
}
//export
export default Accordion
